import React, { useEffect } from 'react';
import {
	Container,
	Typography,
	Box,
	Grid,
	Paper,
	Button,
	IconButton,
} from '@mui/material';
import { useNavigate, useLocation } from 'react-router-dom';
import MedicalServicesIcon from '@mui/icons-material/MedicalServices';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import PhoneIcon from '@mui/icons-material/Phone';
import EmailIcon from '@mui/icons-material/Email';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import LocalHospitalIcon from '@mui/icons-material/LocalHospital';
import HealingIcon from '@mui/icons-material/Healing';
import ChildCareIcon from '@mui/icons-material/ChildCare';
import ElderlyIcon from '@mui/icons-material/Elderly';
import VaccinesIcon from '@mui/icons-material/Vaccines';

function Homepage() {
	const navigate = useNavigate();
	const location = useLocation();

	useEffect(() => {
		if (location.state?.scrollTo) {
			const element = document.getElementById(location.state.scrollTo);
			if (element) {
				element.scrollIntoView({ behavior: 'smooth' });
			}
		}
	}, [location]);

	const services = [
		{
			icon: (
				<MedicalServicesIcon
					sx={{ fontSize: 50, color: 'secondary.main', mb: 2 }}
				/>
			),
			title: 'General Health Checkup',
			description:
				'Comprehensive health screening and preventive care services',
		},
		{
			icon: (
				<LocalHospitalIcon
					sx={{ fontSize: 50, color: 'secondary.main', mb: 2 }}
				/>
			),
			title: 'Dental Care',
			description:
				'Professional dental services including cleaning, filling, and orthodontics',
		},
		{
			icon: (
				<HealingIcon sx={{ fontSize: 50, color: 'secondary.main', mb: 2 }} />
			),
			title: 'Physiotherapy',
			description:
				'Rehabilitation services for injuries and chronic conditions',
		},
		{
			icon: (
				<ChildCareIcon sx={{ fontSize: 50, color: 'secondary.main', mb: 2 }} />
			),
			title: 'Pediatric Care',
			description: 'Specialized healthcare services for children and infants',
		},
		{
			icon: (
				<ElderlyIcon sx={{ fontSize: 50, color: 'secondary.main', mb: 2 }} />
			),
			title: 'Geriatric Care',
			description: 'Dedicated healthcare services for elderly patients',
		},
		{
			icon: (
				<VaccinesIcon sx={{ fontSize: 50, color: 'secondary.main', mb: 2 }} />
			),
			title: 'Vaccination',
			description: 'Complete range of vaccines for all age groups',
		},
	];

	return (
		<Box sx={{ overflow: 'auto', pt: 8 }}>
			{/* Hero Section */}
			<Box
				id="home"
				sx={{
					bgcolor: 'primary.main',
					color: 'primary.contrastText',
					py: 15,
					textAlign: 'center',
					position: 'relative',
					minHeight: '90vh',
					display: 'flex',
					flexDirection: 'column',
					justifyContent: 'center',
				}}
			>
				<Container>
					<Typography variant="h2" component="h1" gutterBottom>
						Welcome to Primer Cherang Clinic
					</Typography>
					<Typography variant="h5" component="h2" gutterBottom>
						Your Health is Our Priority
					</Typography>
					<Button
						variant="contained"
						color="secondary"
						size="large"
						sx={{ mt: 4, px: 4, py: 1.5 }}
						onClick={() => navigate('/booking')}
					>
						Book Appointment
					</Button>
				</Container>
				<IconButton
					sx={{
						position: 'absolute',
						bottom: 20,
						left: '50%',
						transform: 'translateX(-50%)',
						color: 'white',
					}}
					onClick={() =>
						document
							.getElementById('services')
							.scrollIntoView({ behavior: 'smooth' })
					}
				>
					<KeyboardArrowDownIcon sx={{ fontSize: 40 }} />
				</IconButton>
			</Box>

			{/* Services Section */}
			<Box id="services" sx={{ py: 10, bgcolor: 'background.paper' }}>
				<Container>
					<Typography
						variant="h3"
						component="h2"
						gutterBottom
						align="center"
						color="primary"
					>
						Our Services
					</Typography>
					<Grid container spacing={4} sx={{ mt: 4 }}>
						{services.map((service, index) => (
							<Grid item xs={12} md={4} key={index}>
								<Paper
									sx={{
										p: 3,
										textAlign: 'center',
										height: '100%',
										transition: '0.3s',
										'&:hover': {
											transform: 'translateY(-10px)',
											boxShadow: 6,
										},
									}}
								>
									{service.icon}
									<Typography variant="h5" gutterBottom>
										{service.title}
									</Typography>
									<Typography>{service.description}</Typography>
								</Paper>
							</Grid>
						))}
					</Grid>
				</Container>
			</Box>

			{/* Contact Section */}
			<Box id="contact" sx={{ py: 10, bgcolor: 'grey.100' }}>
				<Container>
					<Typography
						variant="h3"
						component="h2"
						gutterBottom
						align="center"
						color="primary"
					>
						Contact Us
					</Typography>
					<Grid container spacing={4} sx={{ mt: 4 }}>
						<Grid item xs={12} md={4}>
							<Paper sx={{ p: 3, textAlign: 'center' }}>
								<LocationOnIcon
									sx={{ fontSize: 40, color: 'secondary.main', mb: 2 }}
								/>
								<Typography variant="h6" gutterBottom>
									Location
								</Typography>
								<Typography>
									123 Cherang Street
									<br />
									Kuala Lumpur, 50450
									<br />
									Malaysia
								</Typography>
							</Paper>
						</Grid>
						<Grid item xs={12} md={4}>
							<Paper sx={{ p: 3, textAlign: 'center' }}>
								<PhoneIcon
									sx={{ fontSize: 40, color: 'secondary.main', mb: 2 }}
								/>
								<Typography variant="h6" gutterBottom>
									Phone
								</Typography>
								<Typography>
									+60 3-1234 5678
									<br />
									Emergency: +60 3-1234 5679
								</Typography>
							</Paper>
						</Grid>
						<Grid item xs={12} md={4}>
							<Paper sx={{ p: 3, textAlign: 'center' }}>
								<EmailIcon
									sx={{ fontSize: 40, color: 'secondary.main', mb: 2 }}
								/>
								<Typography variant="h6" gutterBottom>
									Email
								</Typography>
								<Typography>
									info@primercherang.com
									<br />
									support@primercherang.com
								</Typography>
							</Paper>
						</Grid>
					</Grid>
				</Container>
			</Box>
		</Box>
	);
}

export default Homepage;
